import { HttpClient } from '@angular/common/http';
import { Component, Inject } from '@angular/core';
import { Observable } from 'rxjs';

@Component({
  selector: 'app-home',
  templateUrl: './home.component.html',
})
export class HomeComponent {

  public items: items[] = []; // Corrected variable name
  

  constructor(http: HttpClient) {
    http.get<items[]>('https://localhost:7252/WeatherForecast').subscribe({
      next: (value) => {
        this.items = value;
        console.log(value);
      },
      error: (err) => {
        console.log(err);
      },
    });
  }
}

interface items {
  ID: number;
  FName: string;
  Username: string;
  Password: string;
}
